      <h1
        style={{
          textAlign: "center",
          margin: "0rem 0rem 12rem 0rem",
          padding: "2rem 0rem",
          color: "#f1f4ffff",
        }}
      >
        GUESS THE NAME
      </h1>
      {/* <GameRules /> */}
    </header>
  );
}
